import React from 'react';
import './App.css';

function App() {
  const joinZoomMeeting = async () => {
    try {
      console.log('Sending webhook through proxy...');
      
      const response = await fetch('http://localhost:3005/proxy-webhook', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          event: 'zoom_started',
          timestamp: new Date().toISOString(),
          meeting_id: '88023516261'
        })
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      console.log('Webhook sent successfully:', data);

      // Only open Zoom after webhook is sent successfully
      window.location.href = 'https://us05web.zoom.us/j/88023516261?pwd=UF7Js1R4UteidkilIJn87fJN0e6rmm.1';
    } catch (error) {
      console.error('Failed to send webhook:', error);
      alert('Failed to send webhook. Please try again.');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Join Zoom Meeting</h1>
        <div className="controls">
          <button onClick={joinZoomMeeting}>
            Join Meeting
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
